INSERT INTO `news` (`id`, `title`, `content`, `updated`, `added`, `year_id`) VALUES
  (1, 'Aktualizace po sobotě', 'Oficiální sobotní výsledky můžete najít aktualizované v sekci Tabulky. Také byly přidány fotky za dnešní den. Na prvních místech přenocují celky Tatranu Litovel a Velké Bystřice. Nedělní den bude ve znamení dohrávky turnaje a slavnostního vyhlášení, které se bude konat v 15:00 na hale. Těšíme se na vás a hráče a na všechno!', '2015-04-13 19:09:50', '2015-03-10 21:14:05', 1),
  (2, 'MINICUP 2014 slavnostně ukončen', 'Před malou chvílí byl slavnostně ukončen mezinárodní turnaj miniházené MINICUP 2014 v Litovli! Kategorii mladší miniházené ovládl domácí Tatran Litovel, ve starších o vzájemný zápas vyhrála Velká Bystřice! Gratulujeme, fotky z dnešního dne pro vás připravujeme a k večeru budou v kategorii Fotogalerie.', '2015-03-10 20:14:05', '2015-03-10 21:14:05', 1),
  (5, 'Novinka', '"odkaz":[Team:default]', '2015-03-26 22:09:53', '2015-03-26 23:09:53', 1),
  (6, 'Testovaí odkazová novinka', 'Dlouhý, sakra dlouhý text, ale najednou přichází "odkaz na super věc":[Homepage:informations]', '2015-03-26 22:14:00', '2015-03-26 23:14:00', 1),
  (9, 'Nadpiseček', '**věc co je tučně** věc co není', '2015-03-26 22:16:05', '2015-03-26 23:16:05', 1),
  (10, 'Seznam', '- seznam\n- nějakých kravin\n- a další', '2015-03-26 22:16:42', '2015-03-26 23:16:42', 1),
  (11, 'Tak tohle je fakt husté', '... ->', '2015-03-26 22:17:36', '2015-03-26 23:17:36', 1),
  (12, 'Jsme super přeci!', 'Je to všechno úžasné, co takhle nějaký "odkaz":[Team:detail mladsi, tatran-litovel]', '2015-04-13 19:23:08', '2015-04-13 21:14:32', 1),
  (20, 'Fešný titulek, co?', 'Píšu si nějaký text, co kdybych vložil "informace":[Homepage:informations]?', '2015-04-14 17:54:28', '2015-04-14 19:54:28', NULL);
INSERT INTO `static_content` (`id`, `slug`, `content`, `updated`) VALUES
  (1, '', 'Vítejte!\r\n--------\r\n\r\nMůžete používat syntax Texy!, pokud Vám vyhovuje:\r\n- třeba **tučné** písmo nebo *kurzíva*\r\n- a takto se dělá "odkaz":http://texy.info\r\n- více najdete na stránce \r\n\r\nLook at homepage:[Team:default].\r\n\r\n\r\n"syntax":[syntax]\r\n\r\n\r\nAle také můžete zůstat u HTML:\r\n- takto <b>HTML</b>\r\n- nebo i <b class=xx>úplně <i>hloupě</b>, Texy! to pořeší\r\n\r\n\r\n[syntax]: /cs/syntax', '2015-01-24 20:49:00'),
  (2, 'informations', '<div class="Article">\n<div class="Article__head Box__head">\n	<div class="Article__head__icon Box__head__icon icon__news"></div>\n	<div class="Article__head__text Box__head__text">Informace</div>\n</div>\n<div class="Box__content">\n	<div class="Article__date">Oddíl házené TJ Tatran Litovel Vás srdečně zve k účasti na 3. ročníku mezinárodního turnaje miniházené LITOVEL MINICUP 2015, který se uskuteční v termínu 22. – 24. 5. 2015.</div>\n\n<div class="Article__content">\n				Turnaj je pro určen pro družstva mladší mini (2006 a mladší) a starší mini (2004 – 2005) bez rozdílu \n\npohlaví, tzn. chlapci, dívky, smíšené týmy.Turnaje se může zúčastnit celkem 24 týmů, z toho maximálně 12 týmů v každé věkové kategorii. \n\nVzhledem k co největší atraktivitě turnaje si pořadatel vyhrazuje právo výběru</div>\n\n<div class="Article__heading">Hrací systém:</div>\n<div class="Article__content">4 + 1, každý s každým (každý tým odehraje 11 zápasů), začátek turnaje je v pátek v 13.00 hod</div>\n\n<div class="Article__heading">Hrací doba:</div>\n<div class="Article__content">2 x 10 min s 2 min. přestávkou</div>\n\n<div class="Article__heading">Kde se hraje:</div>\n<div class="Article__content">sportovní hala ZŠ Vítězná (2 hřiště)\nvenkovní areál Sokolovna Litovel (2 hřiště)\nV případě nepřízně počasí budeme nuceni přesunout venkovní zápasy do sportovní haly, tzn. zkrácení hrací doby.</div>\n\n<div class="Article__heading">Ubytování:</div>\n<div class="Article__content">ve třídách ZŠ Vítězná – karimatka, spacák</div>\n\n<div class="Article__heading">Stravování:</div>\n<div class="Article__content">školní jídelna ZŠ Vítězná (snídaně, obědy, večeře)</div>\n\n<div class="Article__heading">Vyhodnocení turnaje:</div>\n<div class="Article__content">1. tři týmy z každé věkové kategorie obdrží pohár, hodnotnou cenu, každý hráč z týmu medaili.\nHráči všech týmů dostanou sladkou odměnu, bude vyhodnocen nejlepší střelec, hráč a brankář každé věkové kategorie</div>\n\n<div class="Article__heading">Program pro děti::</div>\n<div class="Article__content">pátek - diskotéka, sobota – zápas dětských hvězd, trenérů, doprovodný program</div>\n\n<div class="Article__heading">Program pro dospělé:</div>\n<div class="Article__content">večerní posezení v areálu Sokolovny s ochutnávkou místních specialit, doprovodný program</div>\n\n<div class="Article__heading">Doprovodný program:</div>\n<div class="Article__content">k využití volného času Vám nabízíme zajištění - vše v dosahu 300 m od ubytování krytého bazénu s parní místností (ZŠ)\nhřiště na plážový volejbal (házenou) - areál Sokolovny\ntenisový kurt – areál Sokolovny\nprojížďka Litovelským Pomoravím na raftech\nPokud byste měli sportovního vyžití „nad hlavu“, jsme schopni Vám zarezervovat prohlídku blízkých Mladečských jeskyní nebo pohádkového hradu Bouzov (i noční prohlídku). Samozřejmě, že dopravu autobusem jsme schopni také zarezervovat.</div>\n\n<div class="Article__heading">Startovné:</div>\n<div class="Article__content">1 tým z oddílu – 1 500,- Kč, 2 týmy z oddílu 2 400,- Kč</div>\n\n<div class="Article__heading">Ubytování:</div>\n<div class="Article__content">80,- osobu/den, ubytování ve třídách ZŠ Vítězná. Bude vybírána vratná kauce 2 000,- Kč jako záloha na případné poškození vybavení tříd.</div>\n\n<div class="Article__heading">Strava:</div>\n<div class="Article__content">snídaně - 40,-\nOběd – 70,-\nVečeře – 70,-</div></div></div>', '2015-04-08 16:57:19'),
  (3, 'sponsors', '	<div class="Article">\n		<div class="Article__head Box__head">\n			    <div class="Article__head__icon Box__head__icon icon__teams">\n	    </div>\n	    <div class="Article__head__text Box__head__text">Sponzoři</div>\n		</div>\n	    <div class="Box__content Sponzors__content">\n	    	<ul>\n	    		<li class="Sponsors__images">test</li>\n                <li class="Sponsors__images">test</li>\n                <li class="Sponsors__images">test</li>\n                <li class="Sponsors__images">test</li>\n                <li class="Sponsors__images">test</li>\n                <li class="Sponsors__images">test</li>\n                <li class="Sponsors__images">test</li>\n                <li class="Sponsors__images">test</li>\n                <li class="Sponsors__images">test</li>\n                <li class="Sponsors__images">test</li>\n                <li class="Sponsors__images">test</li>\n                <li class="Sponsors__images">test</li>\n                <li class="Sponsors__images">test</li>\n                <li class="Sponsors__images">test</li>\n	    	</ul>\n	    </div>\n	</div>', '2015-04-18 20:59:40'),
